import React, {useState} from 'react'
import {
  CButton,
  CCard,
  CCardBody,
  CCollapse,
  CCardHeader,
  CAlert,
  CCardFooter,
} from '@coreui/react'
import Header from "./Header";
import DocsLink from "../../reusable/DocsLink";

const Setting = (props) => {
  const [collapse, setCollapse] = useState(false)

  const toggle = (e) => {
    setCollapse(!collapse)
    e.preventDefault()
  }

  return (
    <>
      <Header state = {props.state}/>
      <CAlert className={props.state.responseRegister.status === 'Created successful' ?
        'alert-success w-50 m-auto text-center' : `alert-danger w-50 m-auto text-center`}
              id='can_not_create'>{props.state.responseRegister.status}</CAlert>

      <CCard>
        <CCardHeader className='h5'><CButton
          color="primary"
          onClick={toggle}
        >Toggling button</CButton>
          Name
        </CCardHeader>
        <CCollapse show={collapse}>
          <CCardBody>
            AAAAAs
          </CCardBody>
        </CCollapse>
        <CCardFooter>

        </CCardFooter>
      </CCard>
    </>
  )
}

export default Setting;
